import React, { Component } from "react";
import Header from "./components/Header";

import './App.css';

class App extends Component {
  state = {
    response: "Click an image below to begin!",
    score: 0,
    topScore: 0
  };

  render() {
    return (
      <Header response={this} />
    );
  }
}

export default App;
